css:
.github-PrCommitView-container {
  display: flex;
  align-items: center;
  padding: 1rem;
  font-size: 11px;
  border: 1px solid #2e303c;
  border-bottom: none;
}
.github-PrCommitView-container:first-child {
  border-top-left-radius: 4px;
  border-top-right-radius: 4px;
}
.github-PrCommitView-container:last-child {
  border-bottom: 1px solid #2e303c;
  border-bottom-left-radius: 4px;
  border-bottom-right-radius: 4px;
}
.github-PrCommitView-commit {
  flex: 1;
}
.github-PrCommitView-messageHeadline.is-button {
  padding: 0;
  margin-right: 0.66666667rem;
  background-color: transparent;
  border: none;
  cursor: pointer;
  text-align: left;
  color: #d3d6e4;
}
.github-PrCommitView-messageHeadline.is-button:hover,
.github-PrCommitView-messageHeadline.is-button:focus {
  color: #bfc3d1;
}
.github-PrCommitView-title {
  margin: 0 0 .25em 0;
  font-size: 1.2em;
  line-height: 1.4;
}
.github-PrCommitView-avatar {
  border-radius: 4px;
  height: 16px;
  margin-right: .4em;
  width: 16px;
}
.github-PrCommitView-metaText {
  line-height: 16px;
  vertical-align: middle;
  color: #acafbe;
}
.github-PrCommitView-moreButton {
  margin: 0 auto 0 1rem;
  padding: 0em .2em;
  color: #acafbe;
  font-style: italic;
  font-size: .8em;
  border: 1px solid #2e303c;
  border-radius: 4px;
  background-color: #484c5f;
}
.github-PrCommitView-moreButton:hover {
  background-color: #3b3e4d;
}
.github-PrCommitView-moreText {
  margin-top: 0.5rem;
  padding: 0;
  font-size: inherit;
  font-family: var(--editor-font-family);
  word-wrap: initial;
  word-break: break-word;
  white-space: initial;
  background-color: transparent;
}
.github-PrCommitView-sha {
  margin-left: 1rem;
  line-height: 16px;
  vertical-align: middle;
  color: #5cadd6;
  font-family: var(--editor-font-family);
}
.github-PrCommitView-sha a {
  color: inherit;
}
